import React, {useState} from 'react';
import './App.css';
import Login from './components/login';
import Books from './components/bookes';

function App() {

  const[token,setToken] = useState('');

  const userLogin=(tok)=>{
    setToken(tok);
  }
  return (
    <div className="App">
      <Login userLogin={userLogin}/>
      <Books />
    </div>
  );
}

export default App;
